import React from 'react';
import Paper from "@material-ui/core/Paper";


const Question = props => {

    return(
        <Paper>
            <h1>Question id: {props.id}</h1>
            <h2>{props.question.title}</h2>
        </Paper>
    )
}

export default Question;
